import styled from 'styled-components';
import Responsive from './Responsive';
import Button from './Button';
import { Link } from 'react-router-dom';

const NavBlock = styled.div`
position: fixed;
height: 100%;  
width: 12rem;
background: green;
box-shadow: 0px 4px 2px rgba(0, 0, 0, 0.08);


`;
const Wrapper = styled(Responsive)`
  height: 90%;  
  width: 100%;
  background: red;
  display: flex;
  align-items: space-between;
  justify-content: center;
  z-index: 5;

 
`;
const MenuInfo = styled.ul`
font-weight: 800;
margin-right: 1rem;
`

const Spacer = styled.nav`


`;

const Nav = () => {
    return (
        <>
        <NavBlock>
            <Wrapper>
              <MenuInfo><ul><li>메뉴</li>
              <li>메뉴</li>
              <li>메뉴</li>
              <li>메뉴</li>
              <li>메뉴</li></ul></MenuInfo>
              
          
            </Wrapper>
        </NavBlock>
        <Spacer/>
        
        </>
    );
};

export default Nav;
